"   <div class=\"ttl\">",
"    Reticular opacities",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 371px; height: 371px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Standard International Labor Office film for small irregular s opacities, less than 1.5 mm in diameter (reticular opacities).",
"    <div class=\"footnotes\">",
"    </div>",
