"   <p class=\"headingAnchor\" id=\"PATIENT_INFORMATION\">",
"    <span class=\"h1\">",
"     INFORMATION FOR PATIENTS",
"    </span>",
"    &nbsp;&mdash;&nbsp;UpToDate offers two types of patient education materials, &ldquo;The Basics&rdquo; and &ldquo;Beyond the Basics.&rdquo; The Basics patient education pieces are written in plain language, at the 5",
"    <sup>",
"     th",
"    </sup>",
"    to 6",
"    <sup>",
"     th",
"    </sup>",
"    grade reading level, and they answer the four or five key questions a patient might have about a given condition. These articles are best for patients who want a general overview and who prefer short, easy-to-read materials. Beyond the Basics patient education pieces are longer, more sophisticated, and more detailed. These articles are written at the 10",
"    <sup>",
"     th",
"    </sup>",
"    to 12",
"    <sup>",
"     th",
"    </sup>",
"    grade reading level and are best for patients who want in-depth information and are comfortable with some medical jargon.",
"   </p>",
"   <p>",
"    Here are the patient education articles that are relevant to this topic. We encourage you to print or e-mail these topics to your patients. (You can also locate patient education articles on a variety of subjects by searching on &ldquo;patient info&rdquo; and the keyword(s) of interest.)",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      Basics topics (see",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?33/5/33873?source=see_link\">",
"       \"Patient information: Managing pain during labor and delivery (The Basics)\"",
"      </a>",
"      )",
"     </li>",
"    </ul>",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H27\">",
"    <span class=\"h1\">",
"     SUMMARY AND RECOMMENDATIONS",
"    </span>",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      No studies have documented any adverse effects from continuous labor support and most women prefer this intervention.",
"     </li>",
"     <li>",
"      Randomized controlled trials of continuous labor support involving a total of more than 15,000 laboring women have reported inconsistent findings on the effect of this intervention on the progress of labor, use of intrapartum analgesia, mode of delivery, neonatal outcome, maternal experience of birth, postpartum depression and breast feeding. Although two meta-analyses reported benefits [",
"      <a class=\"abstract\" href=\"UTD.htm?22/20/22855/abstract/11,12\">",
"       11,12",
"      </a>",
"      ], the largest study [",
"      <a class=\"abstract\" href=\"UTD.htm?22/20/22855/abstract/13\">",
"       13",
"      </a>",
"      ] did not confirm these advantages of continuous labor support. This difference may reflect the limits of continuous support by labor nurses who are simultaneously responsible for the medical care of the woman and labor support. Doulas may provide more consistent and effective continuous labor support. The benefits of continuous labor support are more pronounced for young, disadvantaged women laboring without a companion, and may be limited to this subgroup. (See",
"      <a class=\"local\" href=\"#H4\">",
"       'Benefits'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      We suggest that continuous labor support be provided by a female caregiver (other than the nurse caring for the patient) (",
"      <a class=\"grade\" href=\"._grade_5?title=Grade 2B\">",
"       Grade 2B",
"      </a>",
"      ). This female caregiver is in addition to the person (male or female) accompanying the parturient. Continuous labor support that begins earlier in labor appears to be more effective than support that begins later in labor. This support appears to be effective in reducing the fear and distress associated with laboring alone in an unfamiliar environment, and has no harmful effects. (See",
"      <a class=\"local\" href=\"#H9\">",
"       'Who should provide labor support?'",
"      </a>",
"      above.)",
"     </li>",
"    </ul>",
"   </p>",
