var title_f22_20_22861="Abciximab is more effective than tirofiban at 30 days after PCI";
var content_f22_20_22861=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F70472&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F70472&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 508px\">",
"   <div class=\"ttl\">",
"    Abciximab is more effective than tirofiban at 30 days after PCI",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 488px; height: 264px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In the TARGET trial of 4809 patients undergoing stenting, the primary end point (composite of death, nonfatal myocardial infarction, or urgent target vessel revascularization at 30 days) was lower with abciximab (6 versus 7.6 percent for tirofiban, hazard ratio 1.26). The benefit of abciximab was limited to patients with an acute coronary syndrome.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Topol EJ, Moliterno DJ, Herrmann HC, et al for the TARGET investigators. N Engl J Med 2001; 344:1888.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
