var title_f22_20_22862="FOXP3 org mutations";
var content_f22_20_22862=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F66800&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F66800&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 594px\">",
"   <div class=\"ttl\">",
"    Mutations in IPEX - Gene organization and selected mutations in FOXP3 and associated functional domains of the gene product",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 574px; height: 219px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    FOXP3, a member of the forkhead box P (FOXP) family of transcription factors, encodes a 431 amino acid protein fundamental to the differentiation of CD4+ regulatory T cells (T",
"    <sub>",
"     Reg",
"    </sub>",
"    ). In addition to the forkhead DNA-binding domain that interacts with the IL2 promoter and other target genes, FOXP3 also contains an N-terminal proline rich domain which regulates transcription. A zinc finger motif may be involved in protein-DNA interactions, while a leucine zipper domain mediates homo and heterodimerization with FOXP3 and other FOXP transcription factors. Except for the zinc finger motif, mutations have been described in patients with IPEX in each of these coding regions.",
"    <div class=\"footnotes\">",
"     Black: exon -1, part of the untranslated 5' region.",
"     <br>",
"      White: 3' untranslated region.",
"      <br>",
"       Grey: untranslated regions prior to start and stop codons.",
"       <br>",
"        Blue: translated regions of protein not included in functional domains.",
"        <br>",
"         Other colored regions on gene correspond to domain names as listed.",
"         <br>",
"          *: Loci associated with disease causing mutations.",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
